import React, {Component} from 'react';
import './App.css';
import Navbar from './Components/Navbar';
import News from './Components/News';
import {
  BrowserRouter as Router,
  Route,
  Routes
} from "react-router-dom";

export default class App extends Component {
  render() {
    const pageSize = 15;

    return (

      <div>

        <Router>


        <Navbar/>

        <Routes>


          <Route exact path='/' element={<News key="general" pageSize={pageSize} country={'in'} category={'general'}/>}></Route>
          <Route exact path='/business' element={<News key="business" pageSize={pageSize} country={'in'} category={'business'}/>}></Route>
          <Route exact path='/entertainment' element={<News key="entertainment"pageSize={pageSize} country={'in'} category={'entertainment'}/>}></Route>
          <Route exact path='/general' element={<News key="general" pageSize={pageSize} country={'in'} category={'general'}/>}></Route>
          <Route exact path='/health' element={<News key="health" pageSize={pageSize} country={'in'} category={'health'}/>}></Route>
          <Route exact path='/science' element={<News key="science" pageSize={pageSize} country={'in'} category={'science'}/>}></Route>
          <Route exact path='/sports' element={<News key="sports" pageSize={pageSize} country={'in'} category={'sports'}/>}></Route>
          <Route exact path='/technology' element={<News key="technology" pageSize={pageSize} country={'in'} category={'technology'}/>}></Route>


                {/* If you want to watch news with types of country */}

          {/* 1. USA */}

          <Route exact path='/' element={<News key="general" pageSize={pageSize} country={'us'} category={'general'}/>}></Route>
          <Route exact path='/USA' element={<News key="business" pageSize={pageSize} country={'us'} category={'business'}/>}></Route>
          <Route exact path='/USA' element={<News key="entertainment" pageSize={pageSize} country={'us'} category={'entertainment'}/>}></Route>
          <Route exact path='/USA' element={<News key="health" pageSize={pageSize} country={'us'} category={'health'}/>}></Route>
          <Route exact path='/USA' element={<News key="science" pageSize={pageSize} country={'us'} category={'science'}/>}></Route>
          <Route exact path='/USA' element={<News key="sports" pageSize={pageSize} country={'us'} category={'sports'}/>}></Route>
          <Route exact path='/USA' element={<News key="technology" pageSize={pageSize} country={'us'} category={'technology'}/>}></Route>

          {/* 2. JAPAN */}

          <Route exact path='/JAPAN' element={<News key="general" pageSize={pageSize} country={'jp'} category={'general'}/>}></Route>
          <Route exact path='/JAPAN' element={<News key="business" pageSize={pageSize} country={'jp'} category={'business'}/>}></Route>
          <Route exact path='/JAPAN' element={<News key="entertainment" pageSize={pageSize} country={'jp'} category={'entertainment'}/>}></Route>
          <Route exact path='/JAPAN' element={<News key="health" pageSize={pageSize} country={'jp'} category={'health'}/>}></Route>
          <Route exact path='/JAPAN' element={<News key="science" pageSize={pageSize} country={'jp'} category={'science'}/>}></Route>
          <Route exact path='/JAPAN' element={<News key="sports" pageSize={pageSize} country={'jp'} category={'sports'}/>}></Route>
          <Route exact path='/JAPAN' element={<News key="technology" pageSize={pageSize} country={'jp'} category={'technology'}/>}></Route>


          {/* 2. AUSTRALIA */}


          <Route exact path='/AUSTRALIA' element={<News key="general" pageSize={pageSize} country={'au'} category={'general'}/>}></Route>
          <Route exact path='/AUSTRALIA' element={<News key="business" pageSize={pageSize} country={'au'} category={'business'}/>}></Route>
          <Route exact path='/AUSTRALIA' element={<News key="entertainment" pageSize={pageSize} country={'au'} category={'entertainment'}/>}></Route>
          <Route exact path='/AUSTRALIA' element={<News key="health" pageSize={pageSize} country={'au'} category={'health'}/>}></Route>
          <Route exact path='/AUSTRALIA' element={<News key="science" pageSize={pageSize} country={'au'} category={'science'}/>}></Route>
          <Route exact path='/AUSTRALIA' element={<News key="sports" pageSize={pageSize} country={'au'} category={'sports'}/>}></Route>
          <Route exact path='/AUSTRALIA' element={<News key="technology" pageSize={pageSize} country={'au'} category={'technology'}/>}></Route> 


        {/* 2. CANADA */}


          <Route exact path='/CANADA' element={<News key="general" pageSize={pageSize} country={'ca'} category={'general'}/>}></Route>
          <Route exact path='/CANADA' element={<News key="business" pageSize={pageSize} country={'ca'} category={'business'}/>}></Route>
          <Route exact path='/CANADA' element={<News key="entertainment" pageSize={pageSize} country={'ca'} category={'entertainment'}/>}></Route>
          <Route exact path='/CANADA' element={<News key="health" pageSize={pageSize} country={'ca'} category={'health'}/>}></Route>
          <Route exact path='/CANADA' element={<News key="science" pageSize={pageSize} country={'ca'} category={'science'}/>}></Route>
          <Route exact path='/CANADA' element={<News key="sports" pageSize={pageSize} country={'ca'} category={'sports'}/>}></Route>
          <Route exact path='/CANADA' element={<News key="technology" pageSize={pageSize} country={'ca'} category={'technology'}/>}></Route> 



        {/* 2. Russia */}
          </Routes>

        </Router>


      </div>
    )
  }
}
